            if (typeof measureVector1 !== 'undefined') {
                OplMapObj.map.removeLayer(measureVector1);
            }
            if (typeof measureVector2 !== 'undefined') {
                OplMapObj.map.removeLayer(measureVector2);
            }

            let activeFeatureObj = WmsOplMapObj.ActiveFeatures;
            if (activeFeatureObj == null) {
                return;
            }
            if (activeFeatureObj.get('RefGrpKey') != "Square") {
                return;
            }

            let geoCoordinates = activeFeatureObj.getGeometry().getCoordinates();
            if (geoCoordinates == null) {
                return;
            }
            if (geoCoordinates[0].length <= 3) {
                return;
            }

            let coord0 = geoCoordinates[0][0];
            let coord1 = geoCoordinates[0][1];
            let coord2 = geoCoordinates[0][2];
            let coord3 = geoCoordinates[0][3];
            let coord4 = geoCoordinates[0][4];

